    <h2 {...{
      "id": "what-is-cloudpanel"
    }}>{`What is CloudPanel?`}</h2>
    <p>{`CloudPanel is a modern server control panel with lightweight components for PHP applications with specific features for all major clouds.
It has been developed with more than ten years of Magento hosting experience in the AWS cloud.`}</p>
    <p>{`With CloudPanel, you can run your favorite PHP application in any cloud or dedicated server within minutes.`}</p>
